import logo from './logo.svg';
import './App.css';
import React, { useState } from 'react';

function App() {

  const [count, setCount] = useState(0);

  return (
    <div className="App">
      <body className="App-header">

        <div id="page_menu">
          DAVID LEYDON
        </div>
        <div id="page_content">
          Section B
          <img src={logo} className="App-logo" alt="logo" />

          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </div>


      </body>
    </div>
  );
}

export default App;
